import 'bootstrap/dist/css/bootstrap.css';
import songList from 'SearchSong';
import Card from 'react-bootstrap/Card';
import Col from 'react-bootstrap/Col';
import Row from 'react-bootstrap/Row';


function ListView(){
    return(
        <div className="cards">
            <Row xs={1} md={2} className="g-4">
                {songList.map((songObj, idx) => (
                <Col key={idx}>
                    <Card>
                    <Card.Img variant="top" src={songObj.album.images[1].url} />
                    <Card.Body>
                        <Card.Title><a href={songObj.external_urls.spotify} target="_blank" rel="noferrel nooppener">{songObj.name}</a></Card.Title>
                        <Card.Text>
                        {songObj.description}
                        </Card.Text>
                    </Card.Body>
                    </Card>
                </Col>
                ))}
            </Row>
      </div>
    );
}

export default ListView;
